{'pk': 17862053254273538, 'user_id': 2090285361, 'text': 'En un ensayo publicado en la Revista Sur en 1953, Cort√°zar rememora al Gardel de los a√±os veinte porque "contiene y expresa al porte√±o encerrado en su peque√±o mundo" y pide escucharlo en la vitrola, ‚Äúcon toda la distorsi√≥n y la p√©rdida imaginables". En ese ensayo, cuenta una an√©cdota que resume la huella que dej√≥ el cantante: "Se la debo a Alberto Girri y me parece un resumen perfecto de la admiraci√≥n de nuestro pueblo por su cantor. En un cine del barrio sur, donde exhiben Cuesta abajo, un porte√±o de pa√±uelo al cuello espera el momento de entrar. Un conocido lo interpela desde la calle: ‚Äú¬øEntr√°s al bi√≥grafo? ¬øQu√© dan?‚Äù Y el otro, tranquilo: ‚ÄúDan una del mudo‚Ä¶‚Äù Con la producci√≥n de la Casa Museo Carlos Gardel, este pack de lujo recopila buena parte de la extensa obra de Carlos Gardel y apunta a revalorizar la m√∫sica en el contexto de sus incursiones cinematogr√°ficas.

Re√∫ne cuatro de sus pel√≠culas de la etapa americana y las canciones que canta. El primer volumen cuenta con los DVDs de las pel√≠culas , ‚ÄúCuesta abajo‚Äù, y ‚ÄúEl tango en Broadway‚Äù. El segundo, con los DVDs de las pel√≠culas ‚ÄúEl d√≠a que me quieras‚Äù y ‚ÄúTango bar‚Äù. Y hay un segundo CD que contiene √©xitos como ‚ÄúPor una cabeza‚Äù, ‚ÄúVolver‚Äù y ‚ÄúArrabal amargo‚Äù. El pack incluye un libro de 84 p√°ginas con una biograf√≠a biling√ºe del Zorzal criollo, fotos in√©ditas, las letras de las canciones incluidas en los films y una sin√≥psis de cada largometraje.
