{'pk': 17949048595109527, 'user_id': 2090285361, 'text': '"El libro de la almohada", de Sei Shonagon, una de las asistentes de menor rango de la emperatriz Sadako, marc√≥ el inicio de la tradici√≥n literaria japonesa. Es el referente de un g√©nero que marc√≥ la √©poca: un libro de notas informal que se guardaba en los cajones de las almohadas que, en aquel momento eran ¬°de madera‚Äì! Con an√©cdotas, anotaciones y descripciones de la vida diaria y de las costumbres, la autora construye un collage, un retrato de la vida en la corte imperial. 
